import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { toast } from 'sonner';
import { 
  Edit2, 
  Trash2, 
  PlusCircle, 
  Save, 
  X, 
  LogOut 
} from 'lucide-react';
import api from '../../services/api';

const Dashboard = () => {
  const navigate = useNavigate();
  const firstName = useSelector((state) => state.auth.first_name);
  
  // State management
  const [apps, setApps] = useState([]);
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    package_name: '',
    points_value: 10,
    category: 'OTHER',
    app_icon: null,
    playstore_link: '',
    is_active: true
  });
  const [isEditing, setIsEditing] = useState(false);
  const [selectedFile, setSelectedFile] = useState(null);

  // Category options with icons
  const CATEGORY_CHOICES = [
    { value: 'GAMES', label: 'Games', color: 'bg-red-500' },
    { value: 'PRODUCTIVITY', label: 'Productivity', color: 'bg-green-500' },
    { value: 'SOCIAL', label: 'Social Media', color: 'bg-blue-500' },
    { value: 'UTILITY', label: 'Utility', color: 'bg-purple-500' },
    { value: 'OTHER', label: 'Other', color: 'bg-gray-500' }
  ];

  // Fetch apps on component mount
  useEffect(() => {
    fetchApps();
  }, []);

  // Fetch apps from backend
  const fetchApps = async () => {
    try {
      const response = await api.get('apps/');
      setApps(response.data);
    } catch (error) {
      console.error('Error fetching apps:', error);
      toast.error('Failed to fetch apps');
    }
  };

  // Input change handlers
  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  // File input handler
  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setSelectedFile(file);
    setFormData(prev => ({
      ...prev,
      app_icon: file
    }));
  };

  // Form submission handler
  const handleSubmit = async (e) => {
    e.preventDefault();
    
    const appData = new FormData();
    Object.keys(formData).forEach(key => {
      if (formData[key] !== null && formData[key] !== '') {
        appData.append(key, formData[key]);
      }
    });

    try {
      if (isEditing) {
        await api.put(`apps/${formData.id}/update/`, appData, {
          headers: { 'Content-Type': 'multipart/form-data' }
        });
        toast.success('App updated successfully');
      } else {
        await api.post('apps/upload/', appData, {
          headers: { 'Content-Type': 'multipart/form-data' }
        });
        toast.success('App added successfully');
      }
      
      resetForm();
      fetchApps();
    } catch (error) {
      console.error('Error submitting app:', error);
      toast.error(error.response?.data?.message || 'Submission failed');
    }
  };

  // Edit app handler
  const handleEdit = (app) => {
    setFormData(app);
    setIsEditing(true);
  };

  // Delete app handler
  const handleDelete = async (appId) => {
    if (window.confirm('Are you sure you want to delete this app?')) {
      try {
        await api.delete(`apps/${appId}/delete/`);
        toast.success('App deleted successfully');
        fetchApps();
      } catch (error) {
        console.error('Error deleting app:', error);
        toast.error('Failed to delete app');
      }
    }
  };

  // Reset form handler
  const resetForm = () => {
    setFormData({
      name: '',
      description: '',
      package_name: '',
      points_value: 10,
      category: 'OTHER',
      app_icon: null,
      playstore_link: '',
      is_active: true
    });
    setSelectedFile(null);
    setIsEditing(false);
  };

  // Logout handler
  const handleLogout = () => {
    localStorage.clear();
    navigate('/login');
  };

  return (
    <div className="min-h-screen bg-gray-950 text-gray-100">
      {/* Navigation */}
      <nav className="bg-black/50 p-4 shadow-lg border-b border-gray-800">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-white font-bold text-2xl flex items-center">
            <PlusCircle className="mr-2 text-blue-500" />
            App Management Portal
          </h1>
          <div className="flex items-center space-x-4">
            <span className="text-gray-300 text-lg">Welcome, {firstName}</span>
            <button
              onClick={handleLogout}
              className="bg-red-600 hover:bg-red-700 text-white px-4 py-2 rounded flex items-center"
            >
              <LogOut className="mr-2" size={18} />
              Logout
            </button>
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <div className="container mx-auto grid md:grid-cols-2 gap-6 p-6">
        {/* App Form */}
        <div className="bg-gray-900 rounded-lg p-6 shadow-xl">
          <h2 className="text-2xl font-bold mb-4 text-white flex items-center">
            {isEditing ? (
              <>
                <Edit2 className="mr-2 text-blue-500" />
                Edit App
              </>
            ) : (
              <>
                <PlusCircle className="mr-2 text-green-500" />
                Add New App
              </>
            )}
          </h2>
          
          <form onSubmit={handleSubmit} className="space-y-4">
            {/* Form inputs (same as previous implementation with minor styling updates) */}
            {/* ... (previous form inputs remain the same) ... */}
            
            <div className="flex space-x-4">
              <button
                type="submit"
                className="bg-green-600 hover:bg-green-700 text-white font-bold py-2 px-4 rounded flex items-center"
              >
                <Save className="mr-2" />
                {isEditing ? 'Update App' : 'Add App'}
              </button>
              {isEditing && (
                <button
                  type="button"
                  onClick={resetForm}
                  className="bg-gray-600 hover:bg-gray-700 text-white font-bold py-2 px-4 rounded flex items-center"
                >
                  <X className="mr-2" />
                  Cancel
                </button>
              )}
            </div>
          </form>
        </div>

        {/* Apps List */}
        <div className="bg-gray-900 rounded-lg p-6 shadow-xl">
          <h2 className="text-2xl font-bold mb-4 text-white">Existing Apps</h2>
          <div className="overflow-x-auto">
            <table className="w-full">
              <thead>
                <tr className="bg-gray-800 text-gray-300">
                  <th className="px-4 py-2">Name</th>
                  <th className="px-4 py-2">Category</th>
                  <th className="px-4 py-2">Points</th>
                  <th className="px-4 py-2">Actions</th>
                </tr>
              </thead>
              <tbody>
                {apps.map((app) => (
                  <tr key={app.id} className="border-b border-gray-800 hover:bg-gray-800/50 transition">
                    <td className="px-4 py-2 text-white">{app.name}</td>
                    <td className="px-4 py-2">
                      <span className={`px-2 py-1 rounded text-xs ${
                        CATEGORY_CHOICES.find(c => c.value === app.category)?.color || 'bg-gray-500'
                      }`}>
                        {app.category}
                      </span>
                    </td>
                    <td className="px-4 py-2 text-white">{app.points_value}</td>
                    <td className="px-4 py-2 flex space-x-2">
                      <button
                        onClick={() => handleEdit(app)}
                        className="bg-blue-500 hover:bg-blue-600 text-white p-2 rounded"
                        title="Edit App"
                      >
                        <Edit2 size={18} />
                      </button>
                      <button
                        onClick={() => handleDelete(app.id)}
                        className="bg-red-500 hover:bg-red-600 text-white p-2 rounded"
                        title="Delete App"
                      >
                        <Trash2 size={18} />
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
